// FrontPageRectangularShape.js
import React from 'react';

const FrontPageRectangularShape = () => {
  const shapeStyle = {
    position: 'absolute', // Positioning the shape using absolute positioning
    left: '287px',        // X position
    top: '84px',          // Y position
    width: '971px',       // Width
    height: '881px',      // Height
    backgroundColor: '#CBB8AF', // Background color
    borderRadius: '16px', // Corner radius
    opacity: 1,           // 100% opacity
    boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.5)', // Drop shadow
    overflowY: 'auto',    // Enable vertical scrolling
    zIndex: 20
  };

  return (
    <div style={shapeStyle}>
      <div className="p-4">
        {/* You can add content inside the shape here */}
        <h1 className="text-black text-xl font-bold">Hello, User!</h1>
        <p className="text-black">Your content goes here.</p>
        {/* Add more content to enable scrolling */}
        <p className="text-black">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        <p className="text-black">Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
        <p className="text-black">Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>
        <p className="text-black">Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.</p>
        <p className="text-black">Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
        {/* Add more content to create a scrollable area */}
      </div>
    </div>
  );
};

export default FrontPageRectangularShape;
